define(function(require){

    var fontUtils = require('utils/font-utils');

    var fonts = {};

    fonts.prime = {};
    
    fonts.prime.normal =  "";

    fonts.prime.bold = "";

    fonts.prime.italic = "";

    fonts.prime.bolditalic = "";

    return {
        name: 'CourierPrime',
        fonts: {
            normal: {
                family: 'CourierPrime',
                src: fontUtils.convertBase64ToBinary(fonts.prime.normal)
            },
            bold: {
                family: 'CourierPrime-Bold',
                src: fontUtils.convertBase64ToBinary(fonts.prime.bold)
            },
            italic: {
                family: 'CourierPrime-Oblique',
                src: fontUtils.convertBase64ToBinary(fonts.prime.italic)
            },
            bolditalic: {
                family: 'CourierPrime-BoldOblique',
                src: fontUtils.convertBase64ToBinary(fonts.prime.bolditalic)
            }
        }
    };

});